import Tab from 'react-bootstrap/Tab'
import Tabs from 'react-bootstrap/Tabs'
import ProjectsTab from './Tabs/ProjectsTab'
import TasksTab from './Tabs/TasksTab'
import MeetingsTab from './Tabs/MeetingsTab'
import { useState } from 'react'
import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';

const Dashboard = ({ type }) => {
    return (
        <Tabs
            id={type}
            defaultActiveKey={type === "employees" ? "projects" : "employees"}
            variant='underline'
            className="mb-3"
            justify
        >
            {type === "employees" ? <Tab eventKey="projects" title="Projekty">
                <ProjectsTab />
            </Tab> : <Tab eventKey="projects" title="Projekty">
                <ProjectsTab />
            </Tab>}
            <Tab eventKey="tasks" title="Zadania">
                <TasksTab />
            </Tab>
            <Tab eventKey="meetings" title="Spotkania">
                <MeetingsTab />
            </Tab>
        </Tabs>
    )
}

export default Dashboard
